import {useState} from 'react'
import React from 'react';
// import logo from './thor.jpg
function Button(){
  const[count,setCount]= useState(0);
  return(
  
    <button onClick={() => setCount(count=>(count+1))}>
      <strong>{count}</strong>
      </button>
  );
}
export default Button;
